import './App.css';
//components
import NavBar from './components/NavBar/NavBar';
import Producto from './components/Product/Product';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Producto title='Tarta de frutilla' price='1300'/>
      <Producto title='Tarta de frutilla' price='2800'/>
      <Producto title='Tarta de frutilla' price='1300'/>
      <Producto title='Tarta de frutilla' price='3000'/>
    </div>
  );
}

export default App;
